import React from 'react';

const BlockInfo = (props) =>{

    console.log(props.information);

    return(
        <div className="container">
            <div className="row">
                <div className="col-sm-7">{props.id}</div>
                <div className="col-sm-3">{props.timestamp}</div>
                <div className="col-sm-2">{props.transactions}</div>
            </div>
        </div>
    )
}

export default BlockInfo;
